import React from 'react'
import {Card, Button} from 'react-bootstrap'
import './Card.css'
import styled from 's'

import lotr from '../images/lord_of_the_rings.jpg'
import hobbit from '../images/the_hobbit.jpg'
import grinch from '../images/the_grinch.jpg'
import sing from '../images/sing.jpg'
import insideOut from '../images/inside_out.jpg'


export default function SubCard(){
    const cardContent = [
        {image: lotr, name: "Netflix", location: "Fantasy/Adventure", price:"2001"}, 
        {image: hobbit, name: "Amazon Prime", location: "Fantasy/Adventure", price:"2013"}, 
        {image: grinch, name: "Netflix", location: "Family/Comedy", price:"2000"}, 
        {image: sing, name: "Netflix", location: "Family/Musical", price:"2016"}
    ]; 

    const renderCard = (card, index) => {
        return (
            <subCard>
                <Card style={{ width: '50rem'}} key={index}>
                <Card.Body>
                    <Card.Text className="subCardTitle">{card.name}</Card.Text>
                    <Card.Text style={{height: '0rem'}} className="">{card.location}</Card.Text>
                    <Card.Text style={{height: '0rem'}} className="">{card.price}</Card.Text>
                    <Card.Link href="">Remove Service</Card.Link>
                    </Card.Body>
                </Card>
            </subCard>
        ); 
    }; 
    return <div className="subGrid">{cardContent.map(renderCard)}</div>; 
}; 

const subCard = styled.div `
    margin: 15px;
    background-color: white;
    border-radius: 10px 10px 10px 10px;
    overflow: hidden;
    height: 100px;
    --webkit-box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3); 
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3); 
`
